// import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import './App.css';
import Login from './component/login';

function App() {
  return (
    <div className="App">
      <Router>
        <switch>
          <route exact path="/"></route>
        </switch>
      </Router>
    </div>
  );
}

export default App;
